    useEffect(() => {
        axios.get('http://127.0.0.1:8000/prodotti/')
        .then(function (response) {
            console.log("res "+response)
            setProdotti(response.data)
            console.log(prodotti.data)
        },)
        .catch(err =>{
            console.log(err)
        })
    },[])
